# Import necessary libraries
# --- Imports ---
import base64

def decode_base64_image(base64_string, output_filename):
    # Strip the header if it exists
    if base64_string.startswith('data:image/'):
        header, base64_string = base64_string.split(',')

    # Decode the Base64 string
    image_data = base64.b64decode(base64_string)

    # Write the decoded image to a file
    with open(output_filename, 'wb') as output_file:
        output_file.write(image_data)

    print(f"Image saved as {output_filename}")

# Example usage
base64_image = "data:image/png;base64,"  # Truncated for simplicity
decode_base64_image(base64_image, "output_image.png")  # Save as PNG

# To save as JPG, just change the output filename
# decode_base64_image(base64_image, "output_image.jpg")
